	/**
	 * @author Jon Wu & Stephen Chern
	 * 
	 * Initializes a heuristic using File f
	 *
	 * @param f the file which the Heuristic is to be initialized off of
	 * @param P The player containing this heuristic
	 */
	public Heuristic(File f, Player P) {
		thisPlayer=P;
		BufferedReader r;
		String s = null;
		try {
			r = new BufferedReader(new FileReader(f));
			s=r.readLine();
		} catch (IOException e) {
			System.out.println(f.getAbsolutePath());
			e.printStackTrace();
		}
		String[] weights=s.split(" ");
		network=new Network();
		network.train(weights);
	}
	
	/**
	 * @author Jon Wu & Stephen Chern
	 * 
	 * Initializes a heuristic using String s
	 * 
	 * @param P The player containing this heuristic
	 */
	public Heuristic(Player P) {
		thisPlayer=P;
		System.out.println("INITIALIZING FROM HARD HEURISTIC");
		String[] weights=s.split(" ");
		network=new Network();
		network.train(weights);
	}

	/**
	 * @author Jon Wu & Stephen Chern
	 * 
	 * assigns values to the input neurons on the neural network (-1, 0, or 1) then calculates
	 * 
	 * @param gs The GameState to be calculated
	 */
	public double calculate(GameState gs) {
		int[] Inputs=new int[64];
		//GET THE INPUT ARRAY FROM THE GAMESTATE
		Location location=new Location();
		for(int r=0;r<8;r++) {
			for(int c=0;c<8;c++) {
				location.x=c;
				location.y=r;
				if(gs.getOwner(location).isEmpty()) {//If unowned
					Inputs[8*r+c]=0;
				}
				else if(gs.getOwner(location).get(0).get(0)==thisPlayer) {//If owned by AI -- happy
					Inputs[8*r+c]=1;
				}
				else {//If owned by non-AI -- sad
					Inputs[8*r+c]=-1;
				}
			}
		}

		//System.err.println(network.calculate(Inputs));
		for(int i:Inputs) {
		//	System.out.print(i+" ");
		}
		return network.calculate(Inputs);
	}

